import Header from "./components/header";
import Game from "./components/game";

const MainPage = () => {
    return (
        <div>
            <Header />
            <div>
                <div>
                    Boxes completed:
                </div>
                <p>Player 1:   Player 2:   Player 3:</p>
                <p>
                    Turn: player 1
                </p>
            </div>
            <Game />
        </div>
    )
}

export default MainPage;
